import React from "react";

export default function About() {
  return (
    <div className="row text-right">
      <h1>About me</h1>
      <p>
        Suspendisse potenti. Proin imperdiet iaculis felis vel auctor. Nullam
        nec turpis quam. Quisque nec metus facilisis, maximus tortor nec,
        faucibus leo. Vestibulum bibendum tortor quis velit pharetra, sed
        pretium orci tristique. Curabitur gravida felis leo, ut euismod velit
        convallis vel. Aenean mi turpis, tempor sit amet aliquet a, dapibus eu
        dolor.
      </p>
    </div>
  );
}
